import React from 'react';

const styles= {
    tags: {
        color: 'white'
    },
    h1: {
        color: 'white'
    }
}
const tags = {
    htmlstart: "<html>",
    bodystart: "<body>",
    h1start: "<h1>",
    htmlend: "</html>",
    bodyend: "</body>",
    h1end: "</h1>",

}
const Landing = () => {

    return(

        <>
        <p style={styles.tags}>{tags.htmlstart}</p>
        <p style={styles.tags}>{tags.bodystart}</p>
        <p style={styles.tags}>{tags.h1start}</p>
        <h1>Chase Lipscomb,</h1>
        <h1>Web Developer</h1>
        <p style={styles.tags}>{tags.h1end}</p>
        <p style={styles.tags}>{tags.bodyend}</p>
        <p style={styles.tags}>{tags.htmlend}</p>

        </>
    )
}
export default Landing
